import React from "react";
import CodeList from "./codeList";
import Editor from "./editor";

function ProjectView(){
    const codeListStyles = {
        width: "10%",
        height: "95vh",
    }

    return(
        <div style={{
            display: "flex"
        }}>
            <CodeList style={codeListStyles}/>
            <Editor />
        </div>
    )
}

export default ProjectView;
